import React from 'react'
import styled from 'styled-components';



const Ul = styled.ul`
    list-style:none;
    display:flex;
    flex-flow:row nowrap;

li{
    padding:18px;
}

@media(max-width:768px){
    display:none;
    flex-flow:column nowrap;
    background-color:white;
    position:fixed;
    top:0;
    right:0;
    height:200px;
    width:300px;
    padding-top:3.5rem;

    li{

        color:violet;
    }
}
`;


function RightNav() {
    return (
        <div>
             <Ul>
            <li>HOME</li>
            <li>BUY A COURSE</li>
            <li>EXPLORE COURSE</li>
            <li>LOGIN</li>
            <li>CREATE ACCOUNT</li>
        </Ul>
        </div>
    )
}

export default RightNav
